import React from "react";
import Header from "../Components/Header";

const Home = () => {
  return (
    <>
      <Header />
      <main>
        <h2>Find the perfect design,</h2>
        <h2>We find the perfect artist.</h2>
      </main>
    </>
  );
};

export default Home;
